import React, { Component } from 'react';
import Navigation from './Navigation';
import savings from '../assets/savings.png';
import '../styles/Savings.css';
import { TwitterClient } from 'twitter-api-client';

const T = new TwitterClient({
  apiKey:         '1LmJOyCH71wBjc5dK8yzCU6sS',
  apiSecret:      'Iu2UDdhVAOkVNMzRQfT4G9D0bU8SskJm1XteWhl5P8hD5NGqXP',
  accessToken:         '723543476-BayWgGbdB94mTOF0qXE4WeOz1HM7XOPDgnXt4nVx',
  accessTokenSecret:  'qNzU7Z9BPPo5rNe6W3mzvVWrmx1voiPvHeNEKd5hl4H9D'
})
async function data(){
    const info =  await T.accountsAndUsers.usersSearch({ q: 'twitterDev' });
    console.log(info);
}
data();

class Savings extends Component {

    render() {
        return (
            <div>
                <Navigation />
                <img id="savings" src={savings} className="pageImg"/>
                <h3 className="pageHeader">SAVINGS</h3>
            </div>
        );
    }
}

export default Savings;
